import { useState, useEffect, Fragment } from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import PageHeader from './components/PageHeader';
import DataTable from './components/DataTable';
import Graphs from './components/Graphs';

function App() {

  let notas = [{"carne":885153505,"nombre":"Heloise Vollam","curso":"LFP","nota":8,"semestre":"2S","year":1988},
  {"carne":73835610,"nombre":"Tisha Neiland","curso":"LFP","nota":39,"semestre":"1S","year":2008},
  {"carne":979534808,"nombre":"Hakeem Frome","curso":"BD1","nota":28,"semestre":"2S","year":1987},
  {"carne":918216903,"nombre":"Salvador Harbidge","curso":"AYD1","nota":37,"semestre":"2S","year":1988}];

  // Estado para almacenar los datos que estarán en la tabla
  const [scores, setScores] = useState([])

  useEffect(() => {
    const getScores = () => {
      const requestInit = {
        Method: 'GET',
        Header: { 'Access-Control-Allow-Origin': '*', 'Content-Type': 'application/json' }
      }

      fetch('http://localhost:9000/api', requestInit)
        .then(res => res.json())
        .then(res => setScores(res))
    }
    getScores()
  }, [])


  return (
    <Fragment>
      <div className="App">
        <Routes>
          <Route path='/' element={<PageHeader />}>
            <Route path='TiempoReal' element={
              <div className='contenedor'>

              </div>
            } />
            <Route path='/' element={
              <div className='contenedor'>
                <br/><br/><br/>
                <DataTable
                Data={scores}/>
                <Graphs/>
              </div>
            } />
          </Route>
        </Routes>
      </div>
    </Fragment>
  );
}

export default App;
